import React, { Component } from 'react';
import Login from './components/login';

class App extends Component {
  componentDidMount() {
    document.title="My React Login - Jimmy Bui";
    this.refs.loading.handleLoading();
  }

  render() {
    return (
      <div id="app">
        <Login refs={this.refs} />
        <Popup ref="popup" />
        <Loading ref="loading" />
      </div>
    )
  }
}

export default App;
